<html>
<head>
	<title>404 Not Found / 生蚝科技</title>
	<meta http-equiv="X-UA-Compatible" content="IE=edge">
	<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
	<style>
		a {
			color: #337ab7;
			text-decoration: none;
		}
		.navbar {
			background-color: #222;
			border-color: #080808;
			position: relative;
			min-height: 50px;
			border: 1px solid transparent;
		}
		.navbar-brand {
			color: #9d9d9d;
			float: left;
			padding: 15px 15px;
			font-size: 17px;
			line-height: 20px;
		}
		.navbar-nav {
			margin: 7.5px -15px;
		}
		.navbar-nav > li > a {
			color: #9d9d9d;
			padding-top: 10px;
			padding-bottom: 10px;
			line-height: 20px;
		}
		.navbar-brand:hover,
		.navbar-brand:focus {
			color: #fff;
			background-color: transparent;
		}
		.container-fluid {
			padding-right: 15px;
			padding-left: 15px;
			margin-right: auto;
			margin-left: auto;
		}
		@media (min-width: 768px) {
			.navbar-header {
				float: left;
			}
			.navbar > .container-fluid .navbar-brand {
				margin-left: -15px;
			}
			.navbar-nav {
				float: left;
				margin: 0;
			}
			.navbar-nav > li {
				float: left;
			}
			.navbar-nav > li > a {
				padding-top: 15px;
				padding-bottom: 15px;
			}
			.navbar-right {
				float: right !important;
				margin-right: -15px;
			}
			.navbar-right ~ .navbar-right {
				margin-right: 0;
			}
		}
	</style>
</head>

<body style="font-family:Microsoft YaHei;background-color:#f9f9f9;margin:0;">
	<nav class="navbar">
		<div class="container-fluid">
			<div class="navbar-header">
				<a class="navbar-brand" href="https://www.xshgzs.com?from=404">生蚝科技生态群</a>

				<div id="phoneNav">
					<a class="navbar-brand" href="javascript:history.go(-1)">&lt; 返回</a>
					<a class="navbar-brand" href="https://www.xshgzs.com?from=404">访问官网</a>
				</div>
			</div>
			<div id="pcNav">
				<ul class="nav navbar-nav">
					<li><a class="navbar-brand" href="javascript:history.go(-1)">&lt; 返回上一页</a></li>
					<li><a class="navbar-brand" href="https://www.xshgzs.com?from=404">访问官网</a></li>
				</ul>
				<ul class="nav navbar-nav navbar-right">
					<li><a id="copyright" class="navbar-brand" href="https://www.xshgzs.com?from=404"></a></li>
				</ul>
			</div>
		</div><!-- /.container-fluid -->
	</nav>

	<script type="text/javascript">
		ua=navigator.userAgent;
		ipad=ua.match(/(iPad).*OS\s([\d_]+)/),
		isIphone=!ipad && ua.match(/(iPhone\sOS)\s([\d_]+)/),
		isAndroid=ua.match(/(Android)\s+([\d.]+)/),
		isMobile=isIphone || isAndroid;
		
		if(isMobile){
			phoneObj=document.getElementById('phoneNav');
			phoneObj.style.display='';
			pcObj=document.getElementById('pcNav');
			pcObj.style.display='none';
		}else{
			date=new Date;
			year=date.getFullYear();
			phoneObj=document.getElementById('phoneNav');
			phoneObj.style.display='none';
			pcObj=document.getElementById('pcNav');
			pcObj.style.display='';
			copyrightObj=document.getElementById('copyright');
			copyrightObj.innerText='© 生蚝科技 2014-'+year;

		}
	</script>

	<img style="width:100%;" src="data:image/png;base64,">
</body>
</html>
